import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { Container, Row, Col } from "react-bootstrap";
import Button from 'react-bootstrap/Button';
import {Navbar, Nav, Form, FormControl} from 'react-bootstrap';
import "./App.css";

class App extends Component {
  render() {
    return (
      <div className="App">
          <Container fluid className="mainimg">
            <p className="para">In Gotham City, mentally troubled comedian Arthur Fleck is disregarded and mistreated by society. 
              He then embarks on a downward spiral of revolution and bloody crime. This path brings him face-to-face with his alter-ego: the Joker.</p>
              <Row>
            <Col sm={4}> <button className="download">Download</button></Col>
          </Row>
          </Container>
        
      </div>
    );
  }
}

export default App;
